            "HotelDescription": [
                "Shangri-La Paris is located adjacent to the Trocadero in the elegant 16th arrondissement - a revered neighborhood with an incomparable Parisian residential feeling. There are breathtaking views of Eiffel Tower - Seine River and Montmartre. The hotel is close to Musee Guimet and Musee Galliera - and is steps from Arc de Triomphe - Champs Elysees - Place du Tocadero - The Eiffel Tower - Avenue Montaigne - and the outdoor market.  Stations for train and metro are within easy reach. For more information on our health and hygiene precautionary measures cancellation fee waivers and Golden Circle - please visit shangri-la.com/cares\n.\nThe hotel has 3 restaurants offering French or Cantonese fine dining or Asian/European cuisine under a stunning glass cupola.  Le Bar Botaniste offers relaxed elegance and welcoming lounges.  Facilities include a business center - tour wireless Internet - the largest indoor swimming pool with natural daylight in Paris - a fully equipped fitness center open 24/7 plus in-room spa services.  Shangri-La Paris is a non-smoking hotel. \n\nBuilt in 1896 as the home of Prince Roland Bonaparte - the property is filled with unique French history and is a Registered Historical Building.  Now architecturally restored and renewed with plush interiors - this exceptional residence is surrounded by a secluded landscaped garden.  There are 101 luxury accommodations with the latest technology - Empire style wood furniture - Shangri-La signature beds - marble bathrooms with heated floors and deep soaking tubs.  The 65 guestrooms are decorated in classical French style with a warm residential feel and most enjoy superb Paris views.  The 36 suites offer expansive luxury with warm French elegance and offer panoramic views of the city - the Eiffel Tower -the River Seine or the Garden.\n CDG - Paris Charles De Gaulle International Airport - 25 km NE\nORY - Paris Orly International Airport - 17 km S\n.\nShangri-La Paris is in the elegant 16th arrondissement - a revered neighborhood with an incomparable Parisian residential feeling.  The hotel overlooks Eiffel Tower and is close to Arc de Triomphe - Champs Elysees - Avenue Montaigne - most of Paris leading museums - and a charming outdoor market. Metro Station Iena and 6 city train stations are within easy reach. SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET SERVICE CHARGE DETAILS TAXES AND SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET TAXES DETAILS "
