                "Located in a quiet alley of the trendy 9th arrondissement of Paris Hotel Adele and Jules is a newly opened 4 star hotel with a very chic Parisian style-It offers all services you would expect such as free high speed WiFi-24 hr reception with full concierge service-an Honesty Bar-room service-a business corner-a fitness room-a meeting room for up to 16 guests-Hotel Adele and Jules offers 4 categories of rooms-The Superior Parisienne-the Deluxe Faubourg-  the Club Boulevard as well as 2 Suites Capitale-All rooms come with a comfortable bed-King size 160 or Super King size 180 or twin beds on request-They are all equipped with 40 inch flat screen TVs with satellite channels-Air conditioning-individual safe which can accommodate a laptop-bathrooms with Shower or Bath-Fragonnard toiletries-bathrobes-hairdryer-In our Deluxe-Club and Suite categories guest can enjoy a Nespresso machine as well as tea facilities-Upon arrival guests can relax and refresh with complimentary mineral water-The hotel offers a complimentary High tea every day from 1600 hours to 1800 hours in the Lounge area-Continental buffet Breakfast is served from 0700 hours to 1130 hours or can also be ordered in room-Thanks to its exclusive location in a private alley and with the addition of sound proof walls guests can enjoy total silence in all room categories  although the neighbourhood raves with restaurants-cafes-bars as well as theatres-The hotel front desk team will be happy to take care of all your needs-restaurant bookings-cultural activities-shopping tips-bicycle rental-transportation including transfer to and from the main airports-Luggage service is free and available at all times The hotel is located 3km N of PAR-Paris-Once a commercial working-class quarter the locality has become an exciting buzzing hub for new French bistronomy-This cosmopolitan district is ideal for exploring on foot-Opera Garnier and the major department stores are within easy walking distance-A chance to immerse yourself in the vibrant heritage of the place in the heart of theatre-land bubbling terraces and covered passages "
