            "HotelDescription": [
                "The 3-star establishment offers you 104 apartments over 7 floors- including 84 studios for 1 or 2 people and 20 one-bedroom apartments for up to 4 people- all air-conditioned. The studios are furnished with sofa beds while in apartments; you can choose to sleep on sofa beds in the lounge area or the double bed in the bedroom. Each studio and apartment houses a bathroom with hairdryer- with separate toilet in the one-bedroom apartments- and a fully-equipped separate kitchen area complete with stove- microwave/grill- dishwasher and fridge. All apartments have hi-fi systems- flat screen TVs with satellite channels- safe deposit boxes- direct-line phones with voicemail and fax facilities and safe deposit box. Linen and towels are provided. The apartment is cleaned and linen and towels are changed once a week free of charge. Additional house-cleaning service is available on request and is charged according to your requirements. 8 apartments are equipped for people with reduced mobility. Located in the former village of Grenelle- not far from UNESCO- the government offices at place de Fontenoy- the dynamic area of Quai Andre Citroen- Quai Branly and Porte de Versailles exhibition parks- this Citadines property here is smack in the centre of a hotbed of activities. Nearby- a bustling market-place heaves with activity. This shopping area is also full of cafes- brasseries with that special Parisian magic. Nearby- the Swiss village and its antique dealers as well as a host of other attractions make this area at the foot of the Eiffel Tower so popular. Stroll around the wide green areas at Champ-de-Mars- the banks of the Seine just 2 metro stations away and Invalids- also 2 stations away.\n\nAscott Cares is our commitment to maintaining safety and hygiene protocols in our property. This is validated by Bureau Veritas to ensure that the necessary health safety and hygiene procedures and processes are in place. Visit www.the-ascott.com/en/ascottcares.html to find out more. Close to the green stretches of the Champ de Mars much beloved by Parisians  and in the shadow of the Eiffel Towel your Apart Hotel enjoys a truly exceptional location in one of Paris s most residential districts.\n\nIn the Front de Seine district  the Beaugrenelle shopping centre contains 45 000 sqm of shops restaurants and leisure attractions. Dawdle on the banks of the Seine which are UNESCO World Heritage sites to contemplate the monuments of Paris\n\n SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET SERVICE CHARGE DETAILS TAXES AND SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET TAXES DETAILS "
