            "HotelDescription": [
                "Step into the Hotel Jardin Le Bréa (superior 3 star hotel), in the centre of Montparnasse district, close to Luxembourg Gardens, Saint-Germain-des-Prés and the Latin district, and drink in the sleek, elegant atmosphere. The hotel is situated on the crossroads between Boulevard Montparnasse and Boulevard Raspail and 150 m from Vavin underground station (Line 4) so travelling around Paris is easy.\nPersonal welcome and first class services await you in the heart of Paris Rive Gauche. Our staff is attentive to your needs and strives to ensure that your stay in the capital is a memorable occasion.\nOur staff welcomes you to our relaxing family establishment all year round. The front desk is open 24/7 and we strive to ensure that your stay in Paris runs smoothly and would be delighted to advise you on places to visit in the capital or make reservations for you.\nThe hotel offers free and unlimited access to : WIFI, computer, printer, Nespresso machine (coffee and tea), luggage room, national and international newspapers, and also have a bar and laundry and dry cleaning service.\n\nOur 23 rooms all offer peace and comfort in a sleek atmosphere... the ideal conditions for working or resting quietly. All are air-conditionned, and have a flatscreen TV, Canal+ , international channels, a telephone, an electronic safety deposit box, and a private bathroom with bath or shower, washbasin, toilet, hairdryer.\n\nGet off to a great start to the day with our gourmet breakfast, served buffet style ! Enjoy it in the vaulted dining room with exposed stone walls and a blend of warm colors, or in your room. -Website : www.Atel-hotels.Com/hotels/f74.Php ---------------------------------------------------- the hotel jardin de brea is located in the 6th arrondissement of paris, in the heart of montparnasse near saint-germain-des-pres and the famous latin district. In a peaceful atmosphere, the hotel offers 23 recently refurbished rooms, boasting a sleek yet cosy decor, snug lounges and a peaceful winter garden. The hotel jardin le brea***sup offers an enchanting break in one of the most beautiful capitals in the world. The hotel jardin le brea***sup is the ideal base from which to explore the french capital. You will be staying in the heart of the montparnasse district in the 6th arrondissement of paris, near saint-germain-des-pres and the latin district. During your stay you can discover all the popular attractions in the city of light: the eiffel tower, notre dame, montmartre and the sacre coeur. Between visiting the collections at the louvre or the musee d'orsay, you can enjoy a spot of shopping in the department stores such as bon marche and the galeries lafayette. Or you can simply enjoy a stroll or a boat trip along the seine and admire this fabulous city. Bridge: - ponts des arts: 1.8 KM / 1.12 MI monuments: - montparnasse tower: 600 m / 0.37 MI - senate - palais du luxembourg: 840 m / 0.52 MI - observatoire de paris: 970 m / 0.6 MI - pantheon: 1.2 KM / 0.75 MI - cathedral notre dame de paris: 1.8 KM / 1.09 MI - sainte chapelle: 1.9 KM / 1.16 MI - hotel des invalides: 2 KM / 1.24 MI - eiffel tower: 3.2 KM / 1.98 MI museums: - fondation cartier pour l'art contemporain: 720 m / 0.45 MI - louvre museum: 2 KM / 1.26 MI - institut du monde arabe: 2.1 KM / 1.29 MI - centre georges-pompidou: 2.5 KM / 1.57 MI parks: - jardin du luxembourg: 320 m / 0.2 MI - jardin des tuileries: 2.2 KM / 1.38 MI sites / districts: - catacombs: 870 m / 0.54 MI - ile saint louis: 2.2 KM / 1.35 MI - chatelet les halles: 2.5 KM / 1.55 MI - marais district: 2.8 KM / 1.74 MI - avenue des champs elysees: 3.8 KM / 2.36 MI spectacle: - theatre de l'odeon: 1 KM / 0.63 MI - theatre du chatelet: 2.1 KM / 1.28 MI - comedie francaise: 2.4 KM / 1.47 MI zoo: - menagerie du jardin des plantes: 2.3 KM / 1.4 MI airports: - orly airport (ory): 13.1 KM / 8.14 MI - roissy charles de gaulle airport (cdg): 24.8 KM / 15.41 MI -Included -City tax not included -No extra child or 