            "HotelDescription": [
                "A little history \nAdjacent to the prestigious former Ecole Polytechnique on the elegant Left Bank of Paris a typically Parisian 19th century building facing a tranquil park is home to the Hotel Residence Henri IV. This hotel occupies a superb location in the heart of Saint Germain des Pres and the historically significant Latin Quarter. \n \nThe Residence Henri IV invites you via its thematic rooms to learn about the famous people who lived under the reign of our Good King Henri. An experience that will immerse you in the heart of our nation history. \n \nDiscover Paris \nWith our hotel as your base you are free to explore the City of Light. Paris will enchant you with its palaces monuments museums parks gardens tree-lined avenues and department stores as well as the theatres cabarets and casinos that bring such vibrancy to the city intense nightlife. \n \n \nLocated in the heart of the Latin Quarter the Residence Henri IV will add magic to your time in the capital and help to ensure a successful stay. You will be staying in a Napoleon III period building built by Jean Marie Boussard in 1879 that enjoys a privileged setting in a district of Paris boasting many attractions. \n \nHere opposite the prestigious old Ecole Polytechnique and close to the Seine and Notre Dame Cathedral you will be within easy walking distance of numerous key locations.  "
