            "HotelDescription": [
                "Ideally located in the 9th arrondissement of Paris- the 4-star Residence Nell welcomes its guests to the intimacy of a private mansion in the center of Paris. Very well connected with public transportation to the main attractions of Paris- the residence is surrounded by countless bars- restaurants and brasseries along with some of the leading performance venues and theatres. Recently refurbished- the 17 studios and apartments are equipped with a 36-inch LED TV with satellite channels- Free Wifi- an iPod and iPhone dock- a Nespresso coffee machine- a dining and seating area and a kitchenette fully equipped with Alessi crockery. The bathroom features a walk in Shower and/or a Bath and is enhanced with high-end complimentary products- monogrammed slippers and fluffy bathrobes. The residence provides to the Guests a 4-star hotel service including Concierge desk 24/7- Laundry service- a luggage room and a selection of books and games are available like Chess- draughts- cards- board games such as Monopoly and Milles Bornes. A continental breakfast menu is offered to be served in their apartment. Ironing facilities are available on request as well as cots- highchairs- bottle warmers and play mats for the youngest ones. Additional Information - Children up to 2 years old can stay in cribs free of charge. Children over 3 year old are considered as an adult.. The hotel reserves the right to without prior notification cancel any reservation with an invalid or incomplete credit card number. Located at the crossroads of Place de l Opera- the Grands Boulevards and the Faubourg Montmartre- in the 9th arrondissement of Paris- Residence Nell is surrounded by various bars and restaurants as well as evening entertainments. The famous Galeries Lafayette and the Printemps Haussmann stores are both less than 15-minute walk away. Close to the Residence- the Richelieu Drouot Metro Station provides direct access to the Eiffel Tower. "
