            "HotelDescription": [
                "The 3-star Hotel Poussin is located in Porte d Auteuil- part of the 16th arondissement in Paris. It borders the famous Bois de Boulogne- parklands and is easily accessible for the river Seine with its extensive promenades. The hotel is conveniently close to the Rolland Garros stadium- Longchamp and Auteuil racecourses- all of which are within a kilometre. Also nearby is the Parc des Expositions at the Porte de Versailles-a strategic business area. The Monet Museum is down the road and the Eiffel Tower 1.5km away. The hotel is welcoming and comfortable with an eclectic mix of antique pieces of furniture mixed with market finds to provide individual touches. The 27 guest rooms have an Art Deco feel and all have Free High Speed WIFI- Flatscreen TV with Satellite channels- MiniFridge that can be stocked for an additional charge- Room Safe-Tea and Coffee making facilities- Work desk and Direct dial telephone. Bathrooms are en suite with Walk in Showers or Bath and overhead shower and Hairdryer. Private Bathroom- Telephone- Work Desk. A buffet breakfast is prepared every morning and served in the dining room. The hotel has a lounge and outside terrace overlooking a pretty courtyard. There is a good choice of restaurants- cafes and bars within the immediate vicinity for dining. Parking is available nearby at an additional cost.\nAdditional information- Children under 2 years can use a crib or cot free of charge. No capacity for extra beds. Children over this age will be considered an adult. The hotel reserves the right without prior notification to cancel any reservation with an invalid or incomplete credit card number. Hotel Poussin is located in the 16th arrondissement of Paris- Porte d Auteuil- on the edge of the famous Bois de Boulogne. Close by are Roland Garros Tennis Club- Parc des Princes stadium and the racetracks of Longchamp and Auteuil. Equally accessible is the Parc des Expositions at Porte de Versailles. The center of Paris is 8km away and easily accessible with a choice of bus and metro stops close by. SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET SERVICE CHARGE DETAILS TAXES AND SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET TAXES DETAILS "
