            "HotelDescription": [
                "Nestled in the storied 16th arrondissement, just a short walk from the Champs-Élysées and the Eiffel Tower, Le Dokhan's, a Tribute Portfolio Hotel, Paris encapsulates the charm of the City of Light. Inside our Belle Époque building a warm welcome awaits, highlighted by authentic works of art by Matisse and Picasso and the delicate scent of a custom-made fragrance. Though we're located in the city center, we're a world away from the hustle and bustle - a boutique retreat that's more like an intimate residence than a hotel. 45 immaculately designed rooms and suites emulate chic Parisian apartments, with home-like amenities including complimentary Wi-Fi, pillowtop beds, complimentary smartphone usage and premium Carita toiletries. Have a seat in a velvet armchair and sip a drink at Bar Le Dokhan's, Paris' first cocktail bar; private gatherings can be arranged here as well. If you're in the mood to explore, the city center is right at your fingertips; walk to the Arc de Triomphe, Avenue Victor Hugo and more. "
