            "HotelDescription": [
                "La Maison Champs Elysees is a member of Design Hotels. Step into a world of comfort and French elegance where reality blends with surreal style at La Maison Champs Elysees in the heart of the Golden Triangle - Although it is ambling distance from the luxury and fashion epicenter Avenue Montaigne -Champs-Elysees and many more of Paris iconic landmarks -the entrance to the townhouse at No 8 rue Jean Goujon is discreet -an address you must know to discover - Behind its doors the stage is set for fashion house Maison Martin Margielas first hotel interior - Their minimal yet sophisticated and offbeat decor makes guests the audience of a theatrical show - The 57 rooms and suites boast state-of-the-art bedding -high-quality linen sheets and mattress pads and duvets in pure goose down - Seventeen rooms and suites belong to the Couture Collection designed by Maison Martin Margiela and are decorated with a touch of whimsy that plays with proportion and perception - Persian rugs are woven into the carpets -walls are covered in wallpaper made from black and white photographs of the gilded lounge on the second floor to reproduce the trompe-l ceil fashion and squares of painted light give the illusion of sun streaming in from the windows - The hotels dedication to comfort is evident throughout with careful attention paid to lighting -acoustics and the finest in-room furnishings - With a philosophy that revolves around light-heartedness -the service is attentive and well-mannered -without being too formal - This laid-back style can be felt in La Table du 8 restaurant and bar where innovative French cuisine is served right through to The Cigar Bar and The White Lounge which is surrounded by a terrace and a dense year-round garden - Discovering No 8 rue Jean Goujon is a unique experience combining generosity -poetry -luxury and lightness -pleasure and an offbeat vision LA MAISON CHAMPS ELYSEES IS ON THE 2012 HOT LISTS FOR BOTH THE UK AND US EDITIONS OF CONDE NAST TRAVELLER\n\nThe hotel is ideally located in the heart of Paris - Two steps only from the Champs Elysees and Avenue Montaigne in the Golden Triangle - Exquisite luxury stores and top fashion designers -the Grand Palais -the Arc de Triomphe -the Louvre and many more of the Paris wonders are a short walk from this superb hotel that offers a dream like bubble of tranquility in the midst of the city SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET SERVICE CHARGE DETAILS TAXES AND SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET TAXES DETAILS "
