            "HotelDescription": [
                "The Vic-Eiffel is a charming hotel, ideally located in the heart of the Left Bank district of Paris: close to the Unesco headquarters, the Pasteur Institute and the Necker Hospital  and not too far from the Eiffel Tower, Les Invalides, Montparnasse and Porte de Versailles. Our fully renovated in 2014 3-star hotel welcomes you into a Parisian mansion atmosphere  with a subtle play on the traditional mansion style adding a contemporary touch. Wood, soft lighting, and judicious use of bright colours amid grey and taupe contribute to the hotels elegant, cosy atmosphere. This haven of peace in central Paris comprises 30 comfortable, air-conditioned, fully soundproofed rooms, some with views of the Eiffel Tower. Whether its during the day or in the evening after sightseeing, shopping or business in the capital, you can enjoy time out in the hotels conservatory or on its pleasant terrace, both great places to relax  and, if you wish, enjoy your breakfast there as you savour the first rays of sunlight. Htel Vic Eiffel staff will give you a warm welcome  and remain at your disposal throughout your stay, taking good care of you, giving you useful information about outings, meeting your needs and making your stay in Paris a real pleasure. Located in the 15th district of Paris, Htel Vic Eiffel offers a 24-hour front desk, a terrace and luggage storage. The Eiffel Tower is a 20-minute walk from the hotel. "
