            "HotelDescription": [
                "Warwick Paris hotel is committed during the COVID-19 health crisis to follow the health and safety guidelines and best practices for the hotel industry in accordance with World Health Organization - the Center for Disease Control guidelines and the American Hotel and Lodging Association.  \n\nWITH ITS 149 SPACIOUS ROOMS AND SUITES THE ELEGANT AND CONTEMPORARY  HOTEL WARWICK PARIS OFFER A SUPERB LOCATION IN THE HEART OF THE CHAMPS ELYSEES AND PROVIDE THE PERFECT SETTING FOR A SUCCESSFUL STAY IN PARIS. \n\nTHE FINE DINING RESTAURANT LE W OFFERS A TANTALISING OPEN AIR KITCHEN DINING EXPERIENCE. FROM FRESH SEASONAL INGREDIENTS AND HERBS FROM LOCAL MARKETS THE CHEF CREATES DISHES WORTHY OF THE HIGHEST STANDARDS IN FRENCH CUISINE. \n\nLE W BAR WITH ITS OPEN FIREPLACE IN WINTER IS PERFECT FOR TEA TIME OR APERITIF AND COCKTAILS. \n\nTHE SUMMER TERRACE RESTAURANT IS ALSO AVAILABLE DURING THE SUMMER FROM MONDAY TO FRIDAY FOR LUNCHES AND DINNERS. \n\nTHE HOTELS CATERING TEAM PROFESSIONALLY ORGANIZES MEETINGS AND CONFERENCES FOR UP 120 PERSONS IN THE STYLISH CONFERENCE ROOMS.\n \nFREE WIFI ACCESS IN THE PUBLIC SPACE OF THE HOTEL LOCATED IN DOWNTOWN PARIS THE WARWICK PARIS IS A LUXURY HOTEL IN PARIS GOLDEN TRIANGLE WHICH ENCOMPASSES THE ETOILE CHAMPS-ELYSEES AND AVENUE GEORGE V SURROUNDED BY HIGH FASHION AND FABULOUS ENTERTAINMENT AS WELL AS THE PARIS BUSINESS DISTRICT.\nTHIS EXQUISITE HOTEL IS A ONE-MINUTE WALK FROM THE PRESTIGIOUS CHAMPS-ELYSEES AND MINUTES FROM POPULAR LANDMARKS ATTRACTIONS AND SIGHTS.\nTHERE ARE FREQUENT BUSES TO WARWICK PARIS HOTEL FROM ALL OVER TOWN AND THE NEAREST UNDERGROUND STATION IS GEORGES V. SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET SERVICE CHARGE DETAILS TAXES AND SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET TAXES DETAILS "
