            "HotelDescription": [
                "Ideally located in a quiet little street, between the Gare du Nord and the Gare de l'Est railway stations, a few steps away from Paris famous department stores, the Hotel Appia La Fayette invites you to a journey of well-being in the heart of a lively area.\nIn the surroundings, you will enjoy many theatres and yesteryear restaurants, the peaceful banks of the Canal Saint Martin, and the well-known ‘Bûte Montmartre’ with the Basilique du Sacré Coeur and its Place du Tertre, famous for its portrait painters…\nFor your business or leisure trips, you will benefit from a direct access to the Villepinte Exhibition Parc, to the Roissy Charles de Gaulle and Le Bourget airports, and to the Stade de France. In the surrounding area you can enjoy theatres, restaurants, the quiet banks of the Saint Martin canal, and the not to be missed village of Montmartre, with the basilica Sacre cur and the Place du Tertre made famous by its portrait artists.\nGrands Boulevards, with its major department stores, theaters and bistros is a 20 minute walk away.\nDirect access with the Metro subway to Place de la Republique 3 stops, Opera and Galerie Lafayette 4 stops and with the RER train to the Stade de France, the CDG airport, the Bourget Airport or the exhibition center of Villepinte.\n \n "
