            "HotelDescription": [
                "Please be aware of signage within the Hotel outlining the COVID 19 Health and Safety procedures in place- hands sanitisers - Contact less payment encouraged - rooms and key card disinfected - reduced seating capacity in restaurant and bar- social distancing encourage - staff training. \nThe Platine Hotel is a four-star hotel where you will enjoy our spa and take advantage of our location close to the Eiffel Tower - the Porte de Versailles Exhibition Centre and the Beaugrenelle shopping centre - From the entrance hall of the establishment down to the smallest details in all of its 46 rooms the atmosphere is warm and inviting - The lighting effects will surprise you - revealing the fine details of unusual textures-vibrant colours and original objects - All our rooms are accessible by a lift-are air conditioned and soundproofed - They are equipped with a LCD screen with iPod connectivity and a FREE WiFi connection - a mini-bar and an en-suite bathroom-with shower unit or whirlpool bath - Some have a private balcony - True invitations to cocooning - they are fitted with comfortable beds and soft cushions which give them a deliciously snug charm - endlessly restful - For a truly relaxing experience the Platine provides access to the luxurious facilities of our wonderful Spa - This includes a Turkish steam bath and a sauna - exclusively for our hotel clients - as well as a double massage room - Our fully equipped seminar room is air-conditioned and can seat up to twelve people - Taking its inspiration from the Situation Room in the White House and elegantly appointed - it is bathed in natural light and opens out onto a directly accessible wide patio - A large screen-video projection and sound equipment are available in this comfortable seminar room which is conducive to reflection and discussion - and you can call on the services of a caterer for your lunch breaks Hotel is located in the centre of Paris - near the Eiffel Tower - Parc des Expositions  - Porte de Versailles  "
