            "HotelDescription": [
                "-Email : contact@hotel-espace-champerret.Com -website : www.Atel-hotels.Com/hotels/k30.Php ---------------------------------------------------- located just a few metres from the metro station and right on the edge of central paris, the hotel espace champerret provides the ideal setting from which to enjoy the capital while being comfortably away from its commotion. The espace champerret convention centre, which hosts a wide variety of trade fairs and other events, is only a hundred metres from the hotel, which is also in close proximity to the palais des congres de paris. In addition, the hotel is within easy reach of the business districts of neuilly and la defense. It is served by metro line 3, which provides quick and convenient access to the grands magasins department stores, the opera district, the saint-lazare railway station and several prestigious museums (musee national jean-jacques henner, musee nissim de camondo, musee jacquemart-andre)... You can reach the champs-elysees avenue on foot in only 30 minutes. The hotel espace champerret offers an ideal location for your stay in paris, allowing you to move throughout the capital with ease. Right on the edge of the city, in the charming suburb of levallois-perret, our hotel enjoys a close proximity to central paris and to the metro station, which is accessible in less than a minute. This line, which crosses paris from west to east, is particularly convenient since it serves the porte de champerret and its trade shows and conferences, the gare saint-lazare, the grands magasins department stores on the boulevard haussmann, the opera, many theatres, the sentier and marais districts, the famous place de la republique, and pere lachaise cemetery. With the espace champerret and the palais des congres being nearby, the hotel is as ideally suited for business trips as it is for holiday breaks and cultural getaways. Business: - espace champerret: 130 m / 0.08 MI - palais des congres - porte maillot: 1.1 KM / 0.67 MI - la defense: 2.8 KM / 1.76 MI entertainment: - lido de paris: 2 KM / 1.27 MI - theatre rutebeuf: 2.2 KM / 1.36 MI - theatre hebertot: 2.4 KM / 1.5 MI - theatre armande bejart: 2.5 KM / 1.56 MI - casino de paris: 3.3 KM / 2.06 MI golf courses: - golf du polo de paris: 4.4 KM / 2.72 MI - golf du bois de boulogne: 4.7 KM / 2.91 MI - le golf de paris: 7 KM / 4.36 MI institutions: - university paris-dauphine: 2.2 KM / 1.39 MI - palais de l'elysee: 3 KM / 1.84 MI - national assembly - palais bourbon: 3.8 KM / 2.36 MI monuments: - arc de triomphe: 1.7 KM / 1.08 MI - cathedrale americaine: 2.5 KM / 1.57 MI - palais de chaillot: 2.9 KM / 1.82 MI - grand palais: 3 KM / 1.89 MI museums: - cite de l'economie et de la monnaie - musee de la banque de france: 1.8 KM / 1.14 MI - musee des arts et traditions populaires: 1.9 KM / 1.19 MI - musee cernuschi: 2.1 KM / 1.29 MI - musee nissim de camondo: 2.1 KM / 1.33 MI - fondation louis vuitton: 2.2 KM / 1.35 MI - musee jacquemart-andre: 2.2 KM / 1.37 MI parks: - bois de boulogne: 1.6 KM / 0.99 MI - parc monceau: 1.8 KM / 1.12 MI - jardin d'acclimatation: 2 KM / 1.26 MI - champ de mars: 3.7 KM / 2.33 MI public squares: - place de la porte maillot: 1.3 KM / 0.78 MI - place charles de gaulle-etoile: 1.7 KM / 1.04 MI shopping: - so ouest shopping center: 790 m / 0.49 MI - avenue des champs-elysees : 1.8 KM / 1.12 MI - department stores printemps & galeries lafayette: 3.5 KM / 2.16 MI airports: - paris-orly airport (ory): 18.8 KM / 11.7 MI - roissy-charles de gaulle airport (cdg): 24 KM / 14.89 MI ---------------------------------------------------- -Included -City tax see rate when checking availability -No extra child or adult allowed "
