                "The 3-star Hotel Madeleine Haussmann is situated in the heart of Paris within walking distance to the Place de la Concorde-Boulevard Haussmann- Tuileries Gardens and the Opera district- home of the Palais Garnier and more. It is close to Gare St Lazare and the Madeleine metro stop giving direct access to many Paris attractions. The building is pristine on the exterior and beautifully decorated inside with a chic at home feel. There are 35 Air-Conditioned- Haussmann- style Rooms well-equipped with complimentary High speed internet- a Safe-  direct dial cordless Telephone- a Flat-Screen TV with Satellite channels- a Minifridge- Work desk and Hairdryer. Bathrooms are en suite with shower or bath and shower combination. Breakfast has been adapted to respect the new health and hygiene regulations. It offers an American style buffet and is available at an additional charge. Breakfast can also be served in-room on request. There is a wide choice of cafes- bars and restaurants nearby. Reception is open 24 hours and the staff is happy to assist guests with concierge services. Parking is available offsite at a charge. Additional Information - Children aged 0-2 stay free. Crib available on request. Children aged 3 and over are considered an adult. Must provide the Hotel with the security code on the credit card. The hotel reserves the right to without prior notification cancel any reservation with an invalid or incomplete credit card number. Located in the heart of the Right Banks most beautiful neighborhood- the Hotel Madeleine Haussmann is close to the Place de la Concorde- Place de Opera and Boulevard Haussmann and 1km from the River Seine. Train station Gare St Lazare is 500m away and the metro station Madeleine is 200m away. Most of the main attractions in Paris are easily accessible on foot or by metro. "
