            "HotelDescription": [
                "Please be aware of signage within the Hotel outlining the COVID 19 Health and Safety procedures in place- hands sanitisers - Contact less payment encouraged - rooms and key card disinfected - reduced seating capacity in restaurant and bar- social distancing encourage - staff training and PPE worn accordingly. \n \nTucked away from the hustle and bustle of the French capital Experimental Group opens its second hotel in Paris - Hotel Grands Boulevards. \nThe hotel comes to life in a large elegant building centred at a unique place in Parisian geography. \nAt the centre of the bourgeois districts not far away from the popular suburbs the hotel is surrounded by the Sentier and its entrepreneurs - the Faubourg Monmatres theatres and the Opera House. \nClose to Strasbourg Saint-Denis sleepless nights and the Faubourg Poissonieres hip restaurants. Set away from the boulevard Hotel Grands Boulevards was erected shortly before the French Revolution built on the foundation of an old garden now a secret garden reached through a long passageway into the building. \nHotel Grands Boulevards is a sumptuous space featuring 50 bedrooms - a restaurant and a rooftop terrace designed by Dorothee Meilichzon. \nInspired by buildings history without falling into the cliche Louis XVI style the interior seduces the senses bridging the gap between romanticism and aristocracy with a gentle nod to the mischievous. The hotel comes to life in a large elegant building centred at a unique place in Parisian geography. At the centre of the bourgeois districts not far away from the popular suburbs the hotel is surrounded by the Sentier and its entrepreneurs - the Faubourg Monmatres theatres and  the Opera House close to Strasbourg Saint-Denis sleepless nights and the Faubourg Poissonieres hip restaurants. "
