            "HotelDescription": [
                "The charming 2-star hotel Clarisse is the ideal place for your leisure or business trips. Located nearby the Exhibition Center Paris Expo- Porte de Versailles, you will be welcomed in a refined and warm atmosphere. You will easily reach many sights thanks to its proximity to many transport systems.\n\nThe hotel Clarisse proposes 27 comfortable rooms, all equipped with a private bathroom (bathub and shower, WC), hairdryer, direct  dial phone, cabled television and Internet access. Some rooms are equipped to welcome disable guests.\n\n\n\n -Email : contact@hotelclarisse.Fr -website : www.Atel-hotels.Com/hotels/499.Php ---------------------------------------------------- nestled in the 15th arrondissement, the hotel clarisse welcomes you to a dynamic district where you will be very close to the most famous monuments of the capital, including the eiffel tower. At the clarisse we like you to feel at home. From the lobby to the rooms, all the decorative details and amenities have been created solely with the comfort and wellbeing of our guests in mind. With its industrial decor comprised of recovered objects and its small but distinct 'british' touches, the clarisse is a hotel with a difference, where warmth and conviviality are always at the forefront. Located in the 15th arrondissement of paris, the clarisse offers the ideal base for exploring the city. The porte de versailles exhibition centre is only a few hundred metres from our address, but if you don't wish to walk, a tram stop is situated in front of the hotel. If you want a breath of fresh air, you can reach the parc georges brassens on foot in just a few minutes and discover its vineyards, sculptures, and bucolic gardens ... The area is full of brasseries and restaurants offering bistronomic cuisine. A corner of paris that is pleasant, dynamic and family-orientated. Catch the metro next to the hotel (porte de vanves station) and reach the various districts and arrondissements of paris with ease.