            "HotelDescription": [
                "The Hotel Phileas Lazare and Spa is conveniently situated in the heart of Paris a short walk from Gare Saint Lazare- the shopping delights of Galeries Lafayette and Le Printemps and the Palace Opera Garnier. This former family house is now a charming hotel with a modern interior and good facilities including a small Hammam. There are 43 bedrooms and all are equipped as standard with Free HS WIFI-Air Conditioning-Private Bathrooms with Bath or Shower- Hairdryer and complimentary toiletries-Satellite TV-Coffee and Team Making facilities-Desk-Pillow options-Electrical Adaptors and minifridge. A delicious buffet breakfast is served daily in the lounge or in room. Lunch and Evening meals can be ordered from the local brasserie via room service and there is an Honest Bar available from 6pm - 11pm.  The hotel has executive facilities for the business traveller including a co-working space and meeting facility. The Hamman has a Jacuzzi- Sauna and treatment rooms offering a range of massages. There is a small meeting room available for guest to book. Parking is available nearby at a cost. Additional Information- Must provide the hotel with the security code on the credit card. Children up to 3 years old can stay in cribs free of charge. Children over 4 years old are considered adult. The hotel reserves the right to cancel any reservation with an invalid or incomplete credit card number without prior notification. Located in the 9th arondissement of Paris close to Gare St Lazare and a 10-minute walk from the Opera Garnier- Galeries Lafayette- Printemps Department Store  There is a choice of metro lines at Saint Lazare with all major attractions of Paris easily accessible. "
