            "HotelDescription": [
                "Location primary airport: charles de gaulle(cdg) 25 KM 15 MI south west secondary airport: orly (ory) 15 KM 9.6 MI north reception hours: 24 hours websites: www.Hoteldefrance.Com contacts: marie-h l NE lochet reception contact@hoteldefrance.Com +33147054049 latitude:+48.853504 north longitude:+2.309355 east property description: in the heart of paris,facing the dome of the invalides,the hotel de france invalides welcome you all year.Our 60 comfortable rooms with bath or shower / wc,hairdryer, telephone,free wireless internet service, modem, flat screen tv (canal + and satellite) and mini-bar, will meet all your requirements. You will also enjoy the buffet breakfast room and private bar in the hotel for a stay combining pleasure and relaxation.All the floors have fire extinguishers and emergency security. Property location: a short walk from the eiffel tower,the ecole militaire and unesco,the hotel de france invalides combines tradition and modernity and the result of its privileged place to stay for the businessman and the tourist.With our central location and our many amenities, you will be 5 minutes from the champs-elysees and the latin quarter.Only 15 minutes from the palais des congres and porte de versailles and its lounges. Point of interests: louvre museum 3.20 KM 1.90 MI south west eiffel tower 1.20 KM 0.70 MI south east montparnasse tower 1.60 KM 1.00 MI north west invalides-napoleon's tomb 0.20 KM 0.10 MI west notre-dame 3.00 KM 1.80 MI south west orsay museum 1.50 KM 0.90 MI south west opera garnier 2.60 KM 1.60 MI south west champs-elysees 1.70 KM 1.00 MI south sacre-coeur 4.40 KM 2.70 MI south west la defense 6.30 KM 3.90 MI south east rodin museum 0.30 KM  0.15 MI west pere-lachaise cemetery 6.20 KM 3.80 MI south west centre george pompidou 3.20 KM 1.90 MI south west paris-expo porte de versailles 2.80 KM 1.70 MI north east paris-expo villepinte 21.00 KM 13.00 MI south west Safety features doors have dead bolts emergency exit maps fire