            "HotelDescription": [
                "The hotel which is unashamedly Parisian and yet as relaxing as a country retreat  intelligent design with a warm welcome  all the comforts of home without the hassle - friendly / interesting / cultured... \nThe shared spaces are warm and friendly  in summer you might open the windows on to the quiet street of Rue Laferriere to catch a gentle breeze  in winter you can curl up at the bottom of a large white sofa with a book or meet your friends for a glass of wine. \nAt the Hotel Arvor quality is always the name of the day. \nAt breakfast time you will delight in finding freshly squeezed orange juice / croissants and organic baguettes from Moisan / Verlet coffee as well as Kusmi teas. The Hotel Arvor offers the following services to facilitate your leisure or business stay and make you feel like home  24-hour front desk service / Free Wifi / complimentary welcome tea / bar / library.     At the foot of Montmartre and 300m from Pigalle and the Moulin Rouge in the 9th arrondissement - you will find us in a quiet spot within one of the most interesting and lively districts in the capital today. Haunt of artists since time immemorial - the area is permeated with a creative bohemian atmosphere - fed by its close proximity to theaters and concert venues. "
