            "HotelDescription": [
                "Nested in a quiet street in the heart of the animated and exclusive 17th district the Glasgow Hotel is very proud to provide much needed peace to guests away from the buzzing city of lights. Near to the Champs Elysees - Montmartre and the Parc Monceau. The hotel is located near metro stations Malesherbes and Villiers just a 5 minute walk from the hotel and bus stops - number 31 and 93 are just 100 metres away - making guests visits easily accessible. \nIntimate and warm design - the hotel is a perfect blend of comfort - refinement and modernity. The hotel offers 37 rooms with all modern comforts - air-conditioning throughout the hotel - free WiFi and flat screen TVs. The new design comes in two colours grey and green - walls painted only with organic paint. Its court side participate to the peaceful atmosphere. \nAn ideal hotel for a holiday or a business trip to Paris. He embodies the character of the neighbourhood. A charming district with numerous restaurants satisfying all tastes as well as one of the best bakeries in Paris and the fabulous Levis market. Contemporary art exhibitions regularly adorn the lobby of the hotel Glasgow Monceau to the delight of guests and Parisians. \nThe establishment provides guests with different services a computer available in the hall - warm coffee and fresh pastries all day - a continental breakfast buffet every morning - a luggage service and also a concierge service. Besides the hotel is open 24 hours and our staff guarantee you a warm and personalised welcome each time. Nested in a quiet street in the heart of the animated and exclusive 17th district the Glasgow Hotel is very proud to provide much needed peace to guests away from the buzzing city of lights. Near to the Champs Elysees - Montmartre and the Parc Monceau. \n \nThe hotel is located near metro stations Malesherbes and Villiers just a 5 minute walk from the hotel and bus stops - number 31 and 93 are just 100 metres away - making guests visits easily accessible.  "
