            "HotelDescription": [
                "This 4-star boutique hotel is located in the heart of Paris 7th arrondisement- just a stones throw away from Place de la Concorde- The Champs-Elysees and the Grand Palais. This stunning building from 1791 reflects the elegance and the aristocratic spirit of one of the most beautiful areas in Paris- overlooking Palais Bourbon- offers the perfect location for those seeking for a break in The City of Light. Each of the 31 elegant and spacious rooms offer High Speed WIFI- Flatscreen TV- Shower or Bath- Telephone and Hairdryer. Guest are welcome to our restaurant area where they can enjoy a delicious breakfast buffet in the morning or drinks in the elegant and intimate bar in the afternoon and evening. Hotel facilities include a Sauna and a deluxe shower where guest can freshen up between sessions. The hotel also has 1 fully equipped meeting room that can cater for a number of events. Parking is available nearby at a charge. Additional Information  Children age 3 and under stay for free. Children over this age will be considered an adult. Maximum occupancy per room is 2 persons with no extra beds. The hotel reserves the right to cancel any reservation made with an invalid or incomplete credit card- including cvv- without prior notification. Bourgogne and Montana Hotel is situated in the very heart of Paris 7th arrondissement- only 10 minutes walk from Place de la Concorde and 20 from the Eiffel Tower. Located on a quiet square opposite the National Assembly- it is easily accesible by public transport.  "
