            "HotelDescription": [
                "Housed in a 19th century palace Hotel de Sers Paris is one of the most magnificent boutique hotels Paris has to offer. A short walk from the Champs-Elysees its located in the heart of Paris. The hotel offers guests a gastronomic restaurant and a relaxing courtyard garden a well-equipped fitness and wellness services. The 52 rooms and suites are stylishly decorated. 50 percent of them offers balcony overlooking Paris and 2 larges Suites with terrasses overlooking Eiffel Tower.\n\nAt B Signature our main priority is the health safety and well-being of our guests our teams and their families. Our teams has already enhanced our robust cleaning and hygiene standards using protocols from the world s leading experts including the World Health Organization. \nWe remain vigilant about the health and safety of all our guests and colleagues without compromising the guest experience.\nIn addition B Signature is committed to providing our guests travel planning flexibility as the situation continues to evolves. \nAs soon as you arrive at your B Signature hotel our teams will welcome you in the best possible conditions ensuring all barrier gestures.\nThe cleaning protocol for our rooms has been redesigned to avoid any risk of contamination. Thus each room will be steam-cleaned to guarantee maximum cleanliness and safety.\nOur room cleaning service will only intervene with your agreement.\nOur restaurants will welcome you for breakfast service while respecting the recommended sanitary measures. Tables will be two meters apart and the timetables will be arranged to limit contact.\nFor more information: https://www.hoteldesers-paris.com/nos-mesures-sanitaires-covid-19\n "
