            "HotelDescription": [
                "The Best Western Premier Faubourg 88 is a design 4 Star hotel ideally located on rue du Faubourg Poissonniere in the north of Paris (tenth district), next to Montmartre and the Canal Saint Martin. Entirely rebuilt, this luxury hotel is within walking distance of the Montmartre neighborhood, the Sacre Coeur, Opera and the Galeries Lafayette. Its proximity with the main train stations make this location perfect for businessmen and tourists arriving from the main airports. The trendy and modern design of the hotel features a beautiful lobby with a private bar open 24 hours a day for the guests only. The 29 rooms provide a cozy and new wave atmosphere with its specific QR code pattern used for the floor decoration. They are divided into classic, superior, executive rooms and junior suite. The rooms are equipped with all the amenities one could expect for a 4 Star luxury hotel: high quality bedding with comfortable duvet, spacious bathroom, complimentary Wi-Fi, large LCD television, screen, Ipod® speakers and room service. The delicious hot buffet served in the bright breakfast room with natural light assures an enjoyable morning. The competent, mindful and pleasant staff of the hotel is available for guests and provides personalized concierge services. "
