                "The Classics Hotel Bastille is a small charming 3 stars hotel with 35 contemporary-styled rooms. The hotel hides a quiet secret garden with lovely trees. The rooms have all been renovated and offer the modern comfort of a 3 stars hotel (free internet wireless, LCD TV 82 cm, safety deposit box, hair dryer). Two rooms are equipped for guests with reduced mobility. Buffet breakfast is served below the veranda. If you wish, in summer time, you can enjoy it in our garden. A private and paying garage is available on request (not accessible for 4X4). All the staff will make a pleasure to help you during your stay. The Classics Hotel Bastille is the ideal hotel for our business clientele or for lovers of Paris sightseeing, in search of a safe and dynamic district. Classics Hotel Bastille is perfectly located between Place de la Bastille, Place de la Nation and the Pere Lachaise cemetery. The Marais and the Louvre Museum are only at a few bus stops. At the Metro stop Charonne, 100 meters from the hotel, you can reach the mains touristic places of Paris like the Department Stores, Champs-Elysees Avenue and Eiffel Tower. "
