            "HotelDescription": [
                "The 4-star Hotel Bachaumont Paris is located in the central district of Montorgueil a lively and trendy neighbourhood.  It is within walking distance to the Louvre Museum- Opera Garnier and Pompidou Center. It has a restaurant with modern-style decor offering traditional French cuisine and La Comptoir- a new Coffee and Patisserie cafe.  The Bar Chaumont has a varied selection of creative cocktails and the great classics. Facilities include a Fitness center and Complimentary High speed Broadband WIFI Internet access is available throughout the building. The eclectic Night Flight Bar- named one of the best bars in the world- now emulated in London- New York and Ibiza- provides inventive- distilled cocktails and music for guests and Parisians alike. The Hotel Bachaumont has 49 rooms- including four suites- each room unique and contemporary- following the natural curve of the building. Handpicked antique furniture and radiant lighting are used to great effect creating an ambience of stylish elegance. Each room features air conditioning- Free high speed WIFI Internet- LCD Flatscreen TV with Cable channels- Safe- MiniFridge- Work desk and SIP telephone.  The private bathrooms have large Shower and hairdryer. The Suites have Bath- Shower and Double sinks. Rooms with Balcony overlook the street.  Inner rooms have a Courtyard view. There are 2 well-equipped and interconnecting meeting rooms that can cater for up to 50 guests seated. Public parking is available nearby at a charge. Additional Information - Must provide the hotel with the security code on the credit card. Up to 2 years stays in a cot or crib at no charge.  Children aged 3 years - 11 years can use an extra bed on request at no charge. Children aged 12 years and over are charged EUR 75 for an extra bed per person per night on request only. Charges are extra and payable on arrival. The hotel reserves the right to without prior notification cancel any reservation with an invalid or incomplete credit card number. Located in a narrow street of one of the most lively and trendy neighborhood of the heart of Paris- Montorgueil -close to Sentier metro station and the Louvre Museum. The Pompidou Centre and the Opera Garnier are both within a 20 minute walk. The nearest airport is Orly Airport at 20 km and CDG at 29km with good connections into Paris.  The nearest main line station is Gare de LEst 3km away. SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET SERVICE CHARGE DETAILS TAXES AND SERVICE CHARGES MAY APPLY - PLEASE CHECK SEAMLESS AVAILABILITY OR PRICING RESPONSE/DISPLAY TO GET TAXES DETAILS "
