            "HotelDescription": [
                "At the heart of the 16th district neighboring the eiffel tower and trocadero brach unveils a space full of freedom and light designed by philippe starck. Brach offers refined comfort and exacting elegance inspired by the modern architecture of the 30s. Combining avant-garde style and timeless appeal brach boasts 59 rooms and suites with terraces. Restaurant serving mediterranean cuisine a pastries corner cocktail bar and a healthy club with his large swimming pool sauna steam room all await you. Designed for locals and travelers alike.\nCovid update: \n\nEvok propreties are required to adhere to comprehensive health and safety official procedures. In addition evok provides hotels with best practices and guidelines.\nEvok propreties have taken steps to ensure our clients safety in terms of hospitality catering and wellbeing.\nGuest rooms are submitted to cleaning products and protocols a secured time after the check out and before the check in with attention to high touch items.\nPublic & meeting spaces and are submitted to the increase of the cleaning frequency and disinfection with a focus on the welcoming desks elevators doors handle public washrooms business centers. \nHealth and safety\nWellbeing and fitness spaces are strictly submitted to the official welcoming and cleaning standards. The wear of probate masks is obligatory for all\nComing client. Provided at check in to the staying clients. Non-provided at the restaurant\nRestaurant\nFood utensils are cleaned through a high temperature dishwasher before being sanitized. All serving cutleries are replaced with clean ones every 30 minutes. The napkins and menus are for single usage. Welcoming organised in respect of the social distancing. Plated service only. Specific periodical cleaning protocol. The traffic direction in /out adapted to the sanitary measures. Mask wearing mandatory from arrival.\n Right bank. Located a few steps from trocadero eiffel tower and champs elysees. "
