            "HotelDescription": [
                "Located in the heart of Paris overlooking the Arc de Triomphe and the top of the famous Champs Elysees. The 3-star Belfast Hotel is an elegant 18th Century building with history and charm embued in its walls with 21st century guest comforts.  Attractions such as the Eiffel Tower- Elysees Palace- Bois de Boulogne and the banks of the river Seine are all within walking distance of the hotel. Gare du Nord station is 5kms away and there are several metro and bus stops around the hotel. Complimentary High Speed Wireless internet access is available throughout the building.  All rooms have air conditioning and double glazed windows. Amenities include Flat screen TV with satellite channels- MiniBar- Room safe- Direct dial telephone- Work desk and Coffee and tea making facilities. En suite bathrooms have Bath and overhead shower- Hairdryer and complimentary toiletry amenities. Some rooms can accommodate an extra bed and the hotel has family room options. There is not a restaurant on site but there is a Breakfast room serving a Continental Buffet Breakfast daily. There is a choice of pretty lounges in which to relax and enjoy a drink from the Bar at the end of the day. In the immediate vicinity there are numerous bars- cafes and restaurants. The hotel has one meeting room that can accommodate up to 22 people. Additional Information  Children under the age of 3 stay free in the room with parents and in existing bedding. Children over this age will be considered an adult. The hotel reserve the right without prior notification to cancel any reservation with an invalid or incomplete credit card number. Prime Paris location just steps from the Arc de Triomphe- opposite the top end of the Avenue des Champs-Elysees. There is a choice of nearby Metro and RER stations- including direct Air France buses to the 2 mian Paris airports. "
