            "HotelDescription": [
                "In the heart of the capital, on the famous Rue du Faubourg Saint-Honore and just a few minutes from the Champs-Elysees, the PLEY HOTEL is a unique and original 4-star hotel. Designed as a place to live, the PLEY has a vintage atmosphere inspired by the 30s with plenty of references to the rich radio history of the 8th arrondissement of Paris where the first Parisian radio stations appeared.The 100 generously sized rooms and suites have a palette of powder blue and pink tones and are dotted with photographs and posters showcasing the history of French radio.The hotels living spaces are filled with transistors and microphones from all over France, period posters and historical books, plunging visitors into a world that is both inspiring and comforting. The PLEY HOTEL also has a restaurant that serves simple and gourmet food, a cocktail and tapas bar, a rooftop terrace with a view of the Eiffel Tower, a fitness centre and numerous work areas. In the basement you will find Le Studio, an intimate and cosy 80m2 lounge decorated to look like a music studio and equipped with a podcast recording studio. On the topfloor of the PLEY HOTEL, you will find the Penthouse, with private access to the hotels rooftop terrace, and theres a large coworking table on the ground floor that everybody can use. The Champs Elysees is known to be the most beautiful avenue of the capital. This great and famous Avenue commonly known as les champs is located in the 8th district of Paris within walking distance to the PLEY Hotel. It connects both the Arc de Triomphe and the Place de la Concorde where you can find the Obelisk.The Champs Elysees is the perfect place for shopping with many shops and prestigious brands.Paris................................... 0.1 K NNanterre................................ 4 K N * Additional Location Information * In the heart of the capital, on the famous Rue du Faubourg Saint-Honore and just a few minutes from the Champs-Elysees, PLEY Hotel is located in the 8th arrondissement of Paris where the first Parisian radio stations appeared. fire security /safes in room / smocke dectectors Local City Tax to be paid at hotel directly. "
