            "HotelDescription": [
                "Located in the heart of Paris near the Eiffel Tower  the Champ de Mars and the river Seine - the 3 star hotel Eiffel Saint Charles \nwelcomes you in a contemporary and warm atmosphere. Whether you are on vacation or business  the hotel offers 33 refurbished rooms  perfectly equipped to provide an oasis of comfort-  as well as a bar for a well-deserved break after your day of visit or work. The entrance of the hotel is wheelchair accessible. All 33 rooms feature air conditioning- double glazing for quiet nights- free high speed WIFI access- desk- flat screen satellite televisions- welcome tray- private safe- private bathrooms with shower or bath and hairdryer. \nBreakfast is served daily in your room from 6.45am to 10am weekly and 7am to 10.30am at weekends. It includes a fresh juice  a hot drink  French pastries and bread  yogurt  cheese butter and jam in individual portions. A Breakfast To Go option is also available for collection at the reception- adapted for COVID measures. Room service for snacks and beverages is available 24 hours a day. \nReception is open 24 hours a day - check in is from 2pm and check out before 12pm. The hotel concierge will be delighted to book any excursions  restaurants  shows  tours and taxis for the guests. The hotel bar is open daily from 11am to 11pm. \nParking is available at charge nearby. A fitness room is available free of charge for all guests  and a Sauna at charge upon previous reservation. \nA new 27m2 air conditioned meeting room is bookable for up to 12 guests for all type of meetings and gatherings with \ncatering available. Free High Speed WIFI is available. \nAdditional Information - Children aged 0-2 stay free. Crib available on request. Children aged 3 and over are considered an adult. Must provide the Hotel with the security code on the credit card. The hotel reserves the right to without prior notification \ncancel any reservation with an invalid or incomplete credit card number. Hotel Eiffel St Charles is 10 minutes walk away from the Eiffel Tower and Champs de Mars - easy access to the Metro - RER and mainland \ntrain stations. The hotel is a short walk away from the Seine river. All tourist attractions and museums are walkable or within a short metro ride. CDG airport is 35 km away and ORY 17 km from the hotel. "
