            "HotelDescription": [
                "Please be aware of signage within the Hotel outlining the COVID 19 Health and Safety procedures in place- hands sanitisers - Contact less payment encouraged - rooms and key card disinfected - reduced seating capacity in restaurant and bar- social distancing encourage - staff training and PPE worn accordingly. \n \nHotel Mansart is ideally located in the heart of Paris at the corner of the prestigious Place Vendome and the rue des Capucines - It is just a few steps from the art and business centres of Paris and many of the most important tourist sights - the Opera - the Madeleine - the Louvre and the Tuileries gardens to name just a few- For those who are keen to shop - chic boutiques and world famous shopping districts such as the Champs Elysees and Les Halles are all within easy reach - Traveling further afield around Paris is no problem with easy access to taxis - buses and the underground \n \n- The Hotel itself offers you charm and comfort in a classic - elegant building built in 1900. Recent renovations have been conceived in memory of Louis XIVs great architect - Jules Hardouin Mansart 1646-1708 - who notably designed the Place Vendome and the Palace of Versailles -  The decoration of the lounge features murals evoking the famous French-style gardens and provides a delightful place to work - relax or meet friends \n \n- As for the bedrooms - 57 in total but each unique in style - they have all preserved the charm and elegance of an old Parisian residence and are spacious and beautifully furnished - The Mansart Room overlooks Place Vendome and surrounds you with the golds of the -Great Century \n \n- Breakfast is served in the magnificent dining room which is dominated by huge stained glass windows - Hotel Mansart offers you the real courtesy of a hearty welcome and a genuine desire to help you enjoy your stay in any way they can Located in the heart of Paris at the corner of the prestigious Place Vendome and the rue des Capucines -A few steps 