            "HotelDescription": [
                "Le Marceau Bastille Hotel gallery is a charming and contemporary 4 star hotel located only a few steps away from the Bastille square and the Gare de Lyon train station and the historic Marais neighbourhood - The hotel interior denotes a characteristically contemporary style - Le Marceau Bastille offers 55 rooms of two kinds - Firstly Urban rooms guarantee a cosy and resolutely avant-garde type atmosphere swathed in vibrant colour - still seeped in elegance -  Secondly the Ecological rooms provide calm and sunshine set off by bright yet soft tones - natural materials - organic forms and sleek lines - For both room types furnishings are contemporary and combine delicacy with modern technology - The lounge and restaurant walls are dedicated to the Arts with permanent collections of contemporary artists - Rooms at Le Marceau Bastille are equipped with air-conditioning - a private bathroom - a bar and free Wi-Fi - telephone and TV - Possibility of a larger room with special accessible equipment for mobility impaired clients only - Please contact Hotel to specifically book this option. \nThe rooms are accessible by 2 elevators - The hot and cold buffet breakfast offers many sweet or savoury dishes scramble eggs - Salmon - various Fresh fruits salads and a selection of French Cheeses The property is located between Le Marais - Bastille square and Gare de Lyon. Historic and Art Area. Place de la Bastille - Opera Bastille - Hotel Sully - Hotel Carnavalet - Institut du Monde Arabe et la Mosquee de Paris - Le Pavillon Arsenal - Le Quartier du Marais - La Place des Vosges - Cour Saint-Emilion. Pleaseant strolls to the following areas - La Promenade Plantee - Le Port de Plaisance de Paris Arsenal - Le Jardin des Plantes and Museum National d-Histoire Naturelle - L-Ile Saint Louis "
