            "HotelDescription": [
                "-Email : contact@hotelparisianer.Com -website : www.Atel-hotels.Com/hotels/k59.Php ---------------------------------------------------- the hotel parisianer is ideally located a short walk from the gare de lyon. Very well served by public transport, you can reach the heart of paris in just a few minutes. Very close to the hotel you will find the place de la bastille and place des vosges; essential places to visit. The bercy business centre and accorhotels arena are also less than a 10-minute walk away. A little further and you will come to the left bank (rive gauche), with the jardin des plantes and its zoo, as well as the museum of natural history. Reach them by crossing one of the famous bridges that span the seine river! on the way, don't MISS the gare d'austerlitz and the city of fashion and design situated on the embankment of the great river. The louvre, the arc de triomphe, the marais and the city's renowned department stores such as printemps and galeries lafayette are all accessible by direct line metro. Take the time to explore the neighbourhood around the hotel. The 12th arrondissement is dynamic and boasts many hidden treasures. Entertainment: - bastille opera: 750 m / 0.47 MI - cafe de la danse: 960 m / 0.59 MI institutions: - cinematheque francaise: 1.1 KM / 0.67 MI - bibliotheque nationale de france : 1.3 KM / 0.83 MI - universite jussieu: 1.5 KM / 0.91 MI - universite sorbonne nouvelle - paris 3: 1.7 KM / 1.04 MI monuments: - eglise saint-paul saint-louis: 1.4 KM / 0.88 MI - paris mosque: 1.5 KM / 0.96 MI - arenes de lutece: 1.7 KM / 1.04 MI - cathedral notre-dame de paris: 2 KM / 1.25 MI - city hall - mairie de paris: 2.1 KM / 1.3 MI - pantheon: 2.2 KM / 1.36 MI museums: - art ludique - le musee: 660 m / 0.41 MI - les docks - la cite de la mode et du design: 670 m / 0.41 MI - pavillon de l'arsenal: 1.1 KM / 0.69 MI - institut du monde arabe: 1.4 KM / 0.85 MI - museum national d'histoire naturelle: 1.4 KM / 0.87 MI - grande galerie de l'evolution: 1.5 KM / 0.9 MI - carnavalet museum: 1.6 KM / 0.99 MI parks: - jardin des plantes: 860 m / 0.53 MI - parc de bercy: 1.3 KM / 0.78 MI public squares: - place de la bastille: 980 m / 0.61 MI - place des vosges: 1.3 KM / 0.81 MI - place de la nation: 1.5 KM / 0.96 MI sport: - accorhotels arena: 820 m / 0.51 MI airports: - paris-orly airport (ory): 13.1 KM / 8.12 MI -  roissy-charles de gaulle airport (cdg): 22.4 KM / 13.9 MI ---------------------------------------------------- -Included -City tax see rate when checking availability -No extra child or adult allowed "
