            "HotelDescription": [
                "The Hotel Monge is a chaming and authentially Parisian 4-star hotel that has always cultivated the art of hospitality 'à la française'. This 30-room boutique hotel, which has long played a significant role in the life of the Latin Quarter, re-opens its doors in spring 2016, having been completely renovated. Behind a typical façade of the Second Empire, overlooking the Arenes de Lutece, with interconnecting reception rooms and exquisite furniture, the Hotel Monge has embraced the benefits of the modern world while retaining the charm of the mansions of the nineteenth century. -WEBSITE : WWW.ATEL-HOTELS.COM/HOTELS/H74.PHP ---------------------------------------------------- THE HOTEL MONGE BOASTS AN IDEAL LOCATION RIGHT IN THE HEART OF THE QUARTIER LATIN, ALLOWING YOU TO STROLL ALONG SOME OF THE OLDEST STREETS OF PARIS, INCLUDING THE RUE MOUFFETARD AND THE PLACE DE LA CONTRESCARPE. ON FOOT YOU CAN VISIT THE LATIN QUARTER, THE PANTHEON AND THE SORBONNE, WANDER TO SAINT GERMAIN DES PRES, THEN CROSS TO THE ILE DE LA CITE AND NOTRE-DAME CATHEDRAL. THE HOTEL MONGE IS ALSO SITUATED BETWEEN THE JARDIN DES PLANTES AND THE JARDIN DU LUXEMBOURG, TWO VERDANT HAVENS OF RELAXATION. AND JUST ACROSS THE SEINE, ON THE RIGHT BANK, YOU WILL FIND VARIOUS MUSEUMS, PALACES AND DEPARTMENT STORES. ENTERTAINMENT: - THEATRE DE L'ODEON: 1.1 KM / 0.7 MI - LE POINT-VIRGULE: 1.5 KM / 0.93 MI - OPERA BASTILLE: 1.5 KM / 0.93 MI - PALAIS OMNISPORTS DE PARIS-BERCY - ACCORHOTELS ARENA: 2.1 KM / 1.27 MI INSTITUTIONS: - JUSSIEU UNIVERSITY: 210 M / 0.13 MI - PARIS-SORBONNE UNIVERSITY: 820 M / 0.51 MI - SENATE: 1.2 KM / 0.75 MI - OBSERVATOIRE: 1.5 KM / 0.94 MI MONUMENTS: - ARENES DE LUTECE: 40 M / 0.02 MI - PANTHEON: 550 M / 0.34 MI - NOTRE-DAME DE PARIS: 970 M / 0.6 MI - HOTEL DIEU: 1.2 KM / 0.72 MI - CONCIERGERIE: 1.3 KM / 0.84 MI - SAINTE CHAPELLE: 1.3 KM / 0.82 MI MUSEUMS: - MUSEUM NATIONAL D'HISTOIRE NATURELLE: 380 M / 0.24 MI - INSTITUT DU MONDE ARABE: 540 M / 0.33 MI - CLUNY MUSEUM