            "HotelDescription": [
                "Renaissance Paris Republique Hotel offers the perfect home base for your visit to the City of Light. Centrally located near Le Marais, one of Paris' most intriguing neighborhoods, our boutique hotel is a short distance from landmarks like Canal Saint-Martin and Opera Garnier; Gare du Nord is easily within reach. Our lodging features impeccable modern design, boutique decor, thoughtful amenities and views of Paris from oversized windows, as well as free Wi-Fi and 24-hour room service. In addition, we invite you to pamper yourself at our hotel spa \"Sothys\" or break a sweat in our gym. Martin Restaurant serves flavorful French cuisine; The Bar is an ideal spot to unwind after a busy day in Le Marais. For those hosting events in Paris, we offer flexible venues with intelligent design, comprehensive planning and catering and a prime location near Gare du Nord. We hope you'll explore while you're in Paris; our boutique hotel's convenient location enables you to discover all that this remarkable city has to offer. "
