            "HotelDescription": [
                "Please be aware of signage within the Hotel outlining the COVID 19 Health and Safety procedures in place- hands sanitisers - Contact less payment encouraged - rooms and key card disinfected - reduced seating capacity in restaurant and bar- social distancing encourage - staff training and PPE worn accordingly. \n \nThe Plumes Hotel is a four-star hotel where you will enjoy and take advantage of our location close to the Opera Garnier - Montmarthe and Sacre Coeur - the North and East Stations and the Galeries Lafayette department store - From the entrance hall of the establishment down to the smallest details in all of its 35 rooms the atmosphere is warm and peaceful - The lighting effects will surprise you -  revealing the fine details of unusual textures - vibrant colours and original objects - All our rooms are  accessible by lifts and are air-conditioned and soundproofed - They are equipped with a LCD screen -  a free Wifi connection and a mini-bar - Some rooms have a private balcony - Les Plumes Hotel Paris invites you on a fascinating journey through time - imbued with the romantic charm of 19th century Paris and on a discovery of the mythical couples who marked this period which yielded an abundance of masterpieces - In the footsteps of Paul Verlaine and Arthur Rimbaud - Victor Hugo and Juliette Drouet or George Sand and Alfred de Musset - you can soak up the typical atmosphere of a period guest house in which everything- from the staff uniforms to the stylish decorative details- draws you into the deliciously romantic atmosphere of that era - You will appreciate the fun dimension of this original hotel which combines historical references and modern facilities as well as the high level of comfort offered throughout the hotel and its 35 rooms - including one suite - which are perfect for relaxing getaways or business trips Central Paris - near the Opera - Galeries Lafayette - Montmartre - Gare du nord "
