            "HotelDescription": [
                "The HC Le R. Kipling Hotel is a new trendy and cosy address down the hill of famous Montmartre. Located in an arty and bobo -bourgeois bohemian- area, the Kipling hotel offers a warm and comfy getaway with its so british post colonial atmosphere.The hotel, which is an homage to the eponym writer Rudyard Kiplings well known for his loves for Asia, Orientalist art and travels, proposes 40 elegant rooms and suites in blue and celadon green shades.From the lobby to the rooms, each piece of furniture, Chesterfield sofa, cabinets, lights and paintings have been bargained-hunt along trips in India, China and Japan to bring the homy ambiance of a gentlemans house.At the Kipling, we explored the World and brought it back for you. Come and share the experience.All things considered, there are only two kinds of men in the world-those that stay at home and those that do not R.Kipling.The HC Le R. Kipling Hotel is part of HappyCulture Collection, an innovative hotels concept focus on the customer experience.Stay in an HappyCulture hotel and enjoy complimentary services in all HappyCulture hotels Coffe machines available 24h/24, Wifi, phones universal chargers, business corners and more... Located in the 9th district of Paris, in between the Opera and Montmartre, on the rue Blanche, the Kipling hotel enjoys a position in one of the trendiest area of Paris South Pigalle.Paris 0.1 Km - South /Versailles 19 Km - South West /Marne la Vallee Eurodisney 35 Km - East /La Defense 8 Km - West /Villepinte Exhibition Center 19 Km - North EastAdidas 0,2 KmCriteo 0,2 KmInteriale Mutuelle 0,2 KmDanone 1 Km Fire security-Safe-Smoke detectors-Sprinklers City Tax 2.88 Euro per adult per night to be paid at hotel directlyVAT included "
